import React from 'react'
import "../Components/Listing.css"
import { useNavigate } from 'react-router-dom';
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";

const Listing = () => {
    const navigate = useNavigate();


const handleLostClick = () => {
  navigate('/lost');
};

const handleFoundClick = () => {
  navigate('/found');
};
const handleListingClick = () => {
  navigate('/listing');
};
const handleMyChatClick = () => {
  navigate('/chat');
};

const handleMyResponseClick = () => {
  navigate('/response');
};

const handleMyHomeClick = () =>{
  navigate("/");
}

const foundItems = [
  { id: 1, itemName: 'Wallet', description: 'Black leather wallet', imageUrl: 'https://via.placeholder.com/150' },
  { id: 2, itemName: 'Keys', description: 'Set of house keys', imageUrl: 'https://via.placeholder.com/150' },
  { id: 3, itemName: 'Phone', description: 'Samsung Galaxy phone', imageUrl: 'https://via.placeholder.com/150' },
  { id: 4, itemName: 'Bag', description: 'Blue backpack', imageUrl: 'https://via.placeholder.com/150' },
  { id: 1, itemName: 'Wallet', description: 'Black leather wallet', imageUrl: 'https://via.placeholder.com/150' },
  { id: 2, itemName: 'Keys', description: 'Set of house keys', imageUrl: 'https://via.placeholder.com/150' },
  { id: 3, itemName: 'Phone', description: 'Samsung Galaxy phone', imageUrl: 'https://via.placeholder.com/150' },
  { id: 4, itemName: 'Bag', description: 'Blue backpack', imageUrl: 'https://via.placeholder.com/150' },
  { id: 1, itemName: 'Wallet', description: 'Black leather wallet', imageUrl: 'https://via.placeholder.com/150' },
  { id: 2, itemName: 'Keys', description: 'Set of house keys', imageUrl: 'https://via.placeholder.com/150' },
  { id: 3, itemName: 'Phone', description: 'Samsung Galaxy phone', imageUrl: 'https://via.placeholder.com/150' },
  { id: 4, itemName: 'Bag', description: 'Blue backpack', imageUrl: 'https://via.placeholder.com/150' },
];
  return (
    <div>
      <div className="redlabel"></div>

      <div className="navbar_listing">
        <div className="home_nav" onClick={handleMyHomeClick}>Home</div>
        <div className="lost_nav1" onClick={handleLostClick}>Lost</div>
        <div className="found_nav" onClick={handleFoundClick}>Found</div>
        <div className="listing_nav_current" onClick={handleListingClick}>My Listing</div>
        <div className="response_nav" onClick={handleMyResponseClick}>My Responses</div>
        <div className="chat_nav" onClick={handleMyChatClick}>My Chats</div>
      </div>
      {/* Making temporary cards.. */}

      <div className="main_container_listing">
      <div className="listing-container">
          {foundItems.map((item) => (
            <Card key={item.id} style={{ width: "18rem" }}>
              <Card.Img variant="top" src={item.imageUrl || "https://via.placeholder.com/150"} alt="Found Item" />
              <Card.Body>
                <Card.Title>{item.itemName}</Card.Title>
                <Card.Text>{item.description}</Card.Text>
                <Button variant="success">Claim</Button>
              </Card.Body>
            </Card>
          ))}
        </div>

      </div>

      


    </div>
  )
}

export default Listing
